import './Profile.css';
import Image from "./Image/Image";
import ProfileCard from "./ProfileCard/ProfileCard";
import Posts from "./Posts/Posts";

const Profile = () => {
	let posts_data = [
		{'id': 1, 'name': 'Post 1'},
		{'id': 2, 'name': 'Post 2'},
		{'id': 3, 'name': 'Post 3'},
		{'id': 4, 'name': 'Post 4'},
		{'id': 5, 'name': 'Post 5'},
		{'id': 6, 'name': 'Post 6'},
		{'id': 7, 'name': 'Post 7'},
	]
	return (
		<div className='profile'>
			<Image/>
			<ProfileCard/>
			<Posts posts_data={posts_data}/>
		</div>
	)
}

export default Profile;
